🌸AZZURA MODEL HUNT JAKARTA 2016🌸

Audisi:
Sabtu, 5 November 2016
di Rabbani Store Rawamangun
10.00-16.00 wib
Dresscode White & Tosca

Final:
Sabtu, 19 November 2016
di Kalibata City Square
13.00-17.00 wib
Dresscode Bohemian Style

Persyaratan:
1. Muslimah berhijab (TIDAK LEPAS PAKAI)
2. Usia 16-28 tahun
3. Tinggi/berat badan proposional
4. Berakhlak baik
5. Peserta wajib follow ig @azzuramodelsjakarta
6. Peserta wajib repost flyer ini serta follow semua sponsor & media partner

Biaya Registrasi:
Rp. 200.000,-/peserta
Rp. 180.000,-/member Azzura Jakarta 2015
(Termasuk snack, sertifikat & membercard)
*5% biaya registrasi akan didonasikan

Waktu Registrasi:
Tanggal 1-31 Oktober 2016

Format Registrasi:
Ketik ➡️ AMHJKT2016 (spasi) NAMA LENGKAP (spasi) USIA (spasi) NO HP (spasi) E-MAIL
Lalu kirim melalui WA/Line ke contact person 081318222848 ( @tikalmd )

